@MathigonOrg ~0,3 #rstats
is_attack &lt;- function(x,y) (x[1]==y[1] || x[2]==y[2]) || (x[1]-y[1]==x[2]-y[2])
one_trial &lt;- function() {
 x &lt;- https://t.co/IXXfJbZxFf(8,2, replace=T)
 y &lt;- https://t.co/IXXfJbZxFf(8,2, replace=T)
 is_attack(x,y)
}
x &lt;- replicate(10^6, one_trial())
sum(x)/length(x)

@MathigonOrg ok, third try: ~0.37, #rstats:
one &lt;- function() {
x &lt;- https://t.co/IXXfJbZxFf(8,2, replace=TRUE)
y &lt;- https://t.co/IXXfJbZxFf(8,2, replace=TRUE)
any(x==y) || diff(abs(x-y))==0
}
z &lt;- replicate(10^6, one())
sum(z)/length(z)

